import react from 'react'

let carrierObj={
border:"3px solid rgba(238, 28, 28, 0.897)",
height:"449px",
width:"500px",
display:"flex",
justifyContent:"space-evenly"
}
let boxObj={
    border:"2px solid red",
    height:"445px",
    width:"95px",
    overflow:"auto"
}
const Emgcarrier=()=>{
    return(
        <>
    <div style={boxObj}>
     </div>
    </>
    )
}
const Gameplay=()=>{
return(
    <>
<div id="carrier" style={carrierObj}>
<Emgcarrier/>
<Emgcarrier/>
<Emgcarrier/>
</div>
    </>
)
}
export default Gameplay
